scido em 23/12/1908, era judeu-alemão que emigrou para Juiz de Fora em 1941. Chegou no Rio de Janeiro em 11/5/1941 com outros judeus-alemães fugindo do nazismo. Em novembro de 1941 fundou a INTEC Gráfica, na avenida Francisco Bernardino, Centro da cidade. Retornou para a Alemanha em 1954. Em 1958 e 1964 esteve no Brasil. Faleceu em Bonn, em 03/5/1994.',NULL,'2021-04-10 18:09:19','2021-04-10 18:09:19'),(447,'Hermenegildo Villaça [Hermenegildo Rodrigues Villaça], médico',99999,'0000-01-01','0000-01-01',NULL,'Foto da residência do Dr. Hermenegildo Villaça, no largo [da igreja] de São Sebastião.','Nascido em 1860 e falecido em 1936, foi médico cirurgião pioneiro na cirurgia em Minas Gerais. Exerceu parte de sua atividade profissional na Santa Casa de Misericórdia de Juiz de Fora. H. Villaça fundou a Faculdade de Medicina de Juiz de Fora e a Companhia de Laticínios de Juiz de Fora; presidiu a Sociedade de Medicina e Cirurgia de Juiz de Fora, foi cafeicultor e pecuarista. ',NULL,'2021-04-10 18:09:19','2021-04-10 18:09:19'),(448,'Hipólito Caron, artista plástico',9,'1888-11-09','1888-11-09','1','Hipólito Caron retorna da Europa para Juiz de Fora.','A notícia cita Jorge Grimm, Hector Hannoteau como seus e professores e França Júnior como seu discípulo.',NULL,'2021-04-10 18:09:19','2021-04-10 18:09:19'),(449,'Hipólito Caron, artista plástico',9,'1888-11-28','1888-11-28','1','Artigo de França Júnior sobre a exposição de H. Caron em Juiz de Fora.',NULL,NULL,'2021-04-10 18:09:19','2021-04-10 18:09:19'),(450,'Hipólito Caron, artista plástico',12,'1889-10-24','1889-10-24','1','Na 5ª coluna informa que foi pedido a H. Caron orçamento de retrato de um monarca recém falecido.',NULL,NULL,'2021-04-10 18:09:19','2021-04-10 18:09:19'),(451,'Hipólito Caron, artista plástico',12,'1889-10-24','1889-10-24','2','Joaquim Campos Porto escreve um longo texto sobre a tela \"Ramos de Flores\" de H. Caron.',NULL,NULL,'2021-04-10 18:09:19','2021-04-10 18:09:19'),(452,'Hipólito Caron, artista plásti